import React from "react";
import { Navbar, Nav, Container } from 'react-bootstrap';
import linkedinLogo from '../assets/linkedin.png';
import githubLogo from '../assets/github.png';

function NavBar() {
  return (
    <Navbar bg="dark" variant="dark">
      <Container>
        <Navbar.Brand>Samuel Saldivar</Navbar.Brand>
        <Nav className="ml-auto">
          <Nav.Link href="https://www.linkedin.com/in/samuel-saldivar-98aa24198/" target="_blank" rel="noopener noreferrer">
            <img src={linkedinLogo} alt="LinkedIn" width="30" height="30" className="d-inline-block align-top" />
          </Nav.Link>
          <Nav.Link href="https://github.com/samuel408" target="_blank" rel="noopener noreferrer">
            <img src={githubLogo} alt="GitHub" width="30" height="30" className="d-inline-block align-top" />
          </Nav.Link>
          <Nav.Link href="/">Home</Nav.Link>
          <Nav.Link href="/about">About</Nav.Link>
          <Nav.Link href="/contact">Contact</Nav.Link>
        </Nav>
      </Container>
    </Navbar>
  );
}

export default NavBar;
